【ナチュラ さら肌さらり 吸水ナプキン 中量用 羽なしの詳細】<br>●表面シートが水分をすーっと引き込み、さらさら感が続きます。<br>●熱や湿気を逃してムレ軽減。<br>●緑茶成分配合。下着内のアンモニア臭と汗臭をしっかり消臭します。香料は使用していません。<br><br>【ご注意】<br>○生理用ナプキンではありません。<br>○経血の吸収には不向きです。<br>○使用後、トイレに捨てないでください。<br>○お肌に合わない時は医師に相談してください。<br>○使用後、トイレに流さないでください。<br>○開封後は、ほこりや虫等が入り込まないよう、衛生的に保管してください。<br><br>【構成材料】<br>表面材：ポリエステル・ポリエチレン、色調：白・青<br><br>【サイズ】<br>24cm（50cc）<br><br>【内容量】<br>22枚入り<br><br>【原産国】<br>日本<br><br>【販売元・製造元・輸入者名】<br>大王製紙<br>東京都千代田区富士見2丁目10番2号 飯田橋グラン・ブルーム(24階)<br>0120-205-205<br><br>【商品区分】<br>衛生医療<br><br>［おりもの&水分ケア］<br><br><br><hr>広告文責：株式会社モリキ<br>電話：0269-38-0611<br><style type="text/css">
