ソルボ中殿筋サポーターメッシュ薄型L<br><br>ソルボ<br>三進興産 ソルボ事業部圧力分散性の高い衝撃吸収素材「ソルボ」を使用したカラダ本来の動きを妨げずない腰・腹用サポーターです。<br>上部ベルトで仙腸関節を固定し、下部ベルトでお尻を下から支えて上部ベルトともにお尻と骨盤を安定を保ちます。<br>アウターにひびかない薄型・軽量・高気性のパワーメッシュ生地採用。<br>Lサイズ(95cm-105cm)。<br> <br>使用方法1.骨盤上部に骨盤(上部)ベルトを止める。2.ソルボ中殿筋パッドをお尻の窪みに当て、中殿筋ベルトを締める。3.全体を微調節し、たるみや歪みを取り、正しく装着する。 使用上の注意<br>●直接肌の上から装着しないでください。<br>●使用中に異常を感じた時はすぐに使用を中止し、医師にご相談ください。<br>●計測値が重なる場合は、大きめのサイズをお選びください。 素材本体：ナイロン、ポリウレタン、ポリエステルパッド(ソルボ)：ポリウレタン、その他 原産国日本 骨盤ベルトとは骨盤ベルトとは、一般的にコルセットより簡易な作りで、帯状のゴム又は伸縮性の素材でできた単純な形のベルトです。骨盤のもっとも出っ張ったところより少し下の脚の付け根あたりに巻きます。骨盤ベルトの伸縮性により骨盤を締め付け、変形もしくは広がってしまった骨盤を正常な形状に矯正することができます。 <br><br>【衛生医療】【サポーター】【腰・腹用】【化粧品】<br><br><br>JANコード:4961928632314<br>三進興産 ソルボ事業部<br><br><br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
